import{_ as a,c as d,o as e,ae as r}from"./chunks/framework.D7Xxp1-g.js";const i="/searobot-docs/images/gt01/image1.png",o="/searobot-docs/images/gt01/image2.png",m=JSON.parse('{"title":"产品简介","description":"","frontmatter":{},"headers":[],"relativePath":"gt01/introduction.md","filePath":"gt01/introduction.md"}'),n={name:"gt01/introduction.md"};function h(l,t,s,c,p,b){return e(),d("div",null,t[0]||(t[0]=[r('<h1 id="产品简介" tabindex="-1">产品简介 <a class="header-anchor" href="#产品简介" aria-label="Permalink to &quot;产品简介&quot;">​</a></h1><p><img src="'+i+'" alt=""></p><p>GT-01 Mini 系列履带式移动平台是一款适用于室内外全地形的中型履带式线控底盘。其主要用于室外越野，农业，地下坑道等场景。GT-01 系列履带底盘适配2套大功率直流无刷伺服电机，两条履带轮均可以独立控制速度。整车VCU基于ARM的控制板，不但可以控制车辆运动行驶，还能直接反馈各个履带速度，电量电压和相关的车辆状态。整车通讯基于232串口/CAN，我们还提供了基于ROS的通讯包可以提供用户直接编译使用。基于GT-01底盘，我们可以在上面支持开发激光导航，GPS巡线，磁导航以及各种运动控制。</p><p><img src="'+o+'" alt=""></p><h2 id="产品优势和特点" tabindex="-1">产品优势和特点 <a class="header-anchor" href="#产品优势和特点" aria-label="Permalink to &quot;产品优势和特点&quot;">​</a></h2><h3 id="机动灵活" tabindex="-1">机动灵活 <a class="header-anchor" href="#机动灵活" aria-label="Permalink to &quot;机动灵活&quot;">​</a></h3><p>GT-01 Mini 系列底盘支持50KG的负载，适用于室外全地形的小型履带式线控底盘。</p><h3 id="高精度控制" tabindex="-1">高精度控制 <a class="header-anchor" href="#高精度控制" aria-label="Permalink to &quot;高精度控制&quot;">​</a></h3><p>通过智澜科技先进的运动控制算法，GT-01 Mini 系列内部还集成了基于ARM的MCU模块，不但可对电机速度做到高精度速度闭环，精确控制速度输出，还可以实时监控车载信息,实时上传。</p><h3 id="标准通讯协议" tabindex="-1">标准通讯协议 <a class="header-anchor" href="#标准通讯协议" aria-label="Permalink to &quot;标准通讯协议&quot;">​</a></h3><p>GT-01 Mini 系列底盘不仅可以实时遥控，还集成了232/CAN输出标准控制协议，通过该协议不仅可以接受实时监控底盘数据，还可以控制底盘运动更新，电机转速等，方便跟上位机/无人驾驶系统等对接开。</p><h3 id="高扩展性" tabindex="-1">高扩展性 <a class="header-anchor" href="#高扩展性" aria-label="Permalink to &quot;高扩展性&quot;">​</a></h3><p>VCU 板块提供232串口和CAN通讯扩展，适配多种任务，可增加多块控制板，扩展运用。</p><h3 id="多电压输出" tabindex="-1">多电压输出 <a class="header-anchor" href="#多电压输出" aria-label="Permalink to &quot;多电压输出&quot;">​</a></h3><p>整车车载电压输出供电，可提供48V/24V/19V/12v等多路电压输出。</p><h3 id="高定制化" tabindex="-1">高定制化 <a class="header-anchor" href="#高定制化" aria-label="Permalink to &quot;高定制化&quot;">​</a></h3><p>GT-01 Mini系列底盘还支持定制化，不但可以根据用户需求设计产品外观，专利授权，还支持增加负载，速度等定制化需求，打造属于自己的小车。而且车身还带有型材等安装支架，可以自行安装固定相关的传感器配件（雷达、GPS、IMU等）。</p><h3 id="产品特点" tabindex="-1">产品特点 <a class="header-anchor" href="#产品特点" aria-label="Permalink to &quot;产品特点&quot;">​</a></h3><ol><li>GT-01 Mini系列底盘为履带底盘，两条履带轮均可以独立控制速度，整车VCU基于ARM的控制板，不但可以控制车辆运动行驶，还能直接反馈各个履带速度，适用于室外越野、农业、地下坑道。</li><li>GT-01 Mini系列无人车支持标准232串口协议，提供多重电源输出接口（48V/24V/19V/12V），方便接入多重传感器模块。</li><li>整车支持ROS基本协议，提供标准接入功能包，支持上手使用，适合广大工程师等开发人员。</li></ol><h2 id="产品配件列表" tabindex="-1">产品配件列表 <a class="header-anchor" href="#产品配件列表" aria-label="Permalink to &quot;产品配件列表&quot;">​</a></h2><table tabindex="0"><thead><tr><th>底盘配件清单</th><th>数量</th></tr></thead><tbody><tr><td>GT-01 Mini 机器人本体</td><td>1套</td></tr><tr><td>锂电池充电器（AC220V）</td><td>1套</td></tr><tr><td>对外供电模块</td><td>1台</td></tr><tr><td>2.4G 航模遥控器</td><td>1套</td></tr><tr><td>供电插头</td><td>1套</td></tr></tbody></table><p><strong>底盘选配清单</strong></p><table tabindex="0"><thead><tr><th>选配项</th><th>数量</th><th>选配项</th><th>数量</th></tr></thead><tbody><tr><td>激光导航模组</td><td>1套</td><td>RTK导航套件</td><td>1套</td></tr><tr><td>单线/多线激光雷达</td><td>1套</td><td>导航主机</td><td>1套</td></tr><tr><td>IMU</td><td>1套</td><td>天线蘑菇头</td><td>1套</td></tr><tr><td>自动回充模块</td><td>1套</td><td>RGBD相机</td><td>1套</td></tr></tbody></table>',23)]))}const _=a(n,[["render",h]]);export{m as __pageData,_ as default};
